import React from 'react';
import Navbar from './Navbar';
function Dashbaord() {
    return (
        <div>
            <Navbar />
            <div className='row'>
                <div className='col-3'>start time</div>
                <div className='col-3'>end  time</div>
                <div className='col-3'>period</div>
                <div className='col-3'>update</div>
            </div>
        </div>
    )
}

export default Dashbaord;
